import React, { useEffect, useState } from "react";
import { useDarkMode } from "../customeMethods/DarkModeContext";
import Logo from "./navBarComponunts/Logo";
import DarkModeBtn from "./navBarComponunts/DarkModeBtn";

function NavBar() {
  // handale with mode click btn
  const { darkMode, toggleDarkMode } = useDarkMode();

  useEffect(() => {}, [darkMode]);

  // Return Elements:
  return (
    <nav
      id="nav"
      className={`bottom-shadow navbar navbar-expand-lg bg-body-tertiary position-sticky ${
        darkMode ? " spic-dark-mode" : "light"
      } bg-white`}
    >
      <div className="container">
        <Logo />
        <DarkModeBtn />
      </div>
    </nav>
  );
}

export default NavBar;
